const apiKey = '83i7O10QCBh6UcA8OfZ2Bn9UJPR4f356';

const peticion = fetch (`https://api.giph.com/v1/gifs/random?api_key=${apiKey}`);

peticion.then ( (respuesta) => {
    respuesta.json().then ( (datos) => {
        console.log(datos);
    })
})
.catch (err => console.warn('Error', err));
